import React from "react";
import {NavLink} from "react-router-dom";
import '../Elements/Button/button.scss'

// import {Link} from 'react-scroll'

const Menu = () => {

  return (
    <div className="o-col o-col--lg75 t-site-header__menu">
      <nav className="c-nav">

          <li><NavLink exact to="/"   className="btn">Start</NavLink></  li>
          <li className="btn">O co chodzi</ li>
          <li className="btn">O nas</li>
          <a class="c-nav__item" href="#">Fundacje i  organizacje</a>
          <a class="c-nav__item" href="#">Kontakt</a>

      </nav>
    </div>
  )
}

export default Menu;
